import React from 'react';

const LoginForm = () => {
  return (
    <div className="login-form-container">
      <div id="close-login-btn" className="fas fa-times"></div>

      <form action="/login">
        <h3>Sign In</h3>

        <span>Username</span>
        <input type="email" name="email" className="box" placeholder="Enter your email" id="email" />

        <span>Password</span>
        <input type="password" name="password" className="box" placeholder="Enter your password" id="password" />

        <div className="checkbox">
          <input type="checkbox" name="remember" id="remember-me" />
          <label htmlFor="remember-me">Remember me</label>
        </div>

        <input type="submit" value="Sign in" className="btn" />

        <p>Forgot password? <a href="#">Click here</a></p>
        <p>Don't have an account? <a href="#">Create one</a></p>
      </form>
    </div>
  );
};

export default LoginForm;

/*
Giải thích:
- Đây là component LoginForm chứa form đăng nhập.
- Bao gồm các trường email, password, checkbox nhớ đăng nhập, và các liên kết hỗ trợ.
- Giữ nguyên cấu trúc và className để áp dụng CSS.
- Sử dụng htmlFor thay cho for trong label để phù hợp JSX.
*/
